import React, { Component } from "react";
import Navigation from "./navigation";
import Content from "./content";
import Footer from "./footer";

class HomePage extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <Content />
        <Footer />
      </div>
    );
  }
}

export default HomePage;
